import React from 'react';

import './custom-button.styles.scss'

const CustomButton = ({ children, isGoogleSignIn, inverted,  ...props }) => (
    <button
        className={`custom-button 
            ${inverted ? 'inverted' : ''}
            ${isGoogleSignIn ? 'google-sign-in' : ''}`}
            {...props}>
        {children}
    </button>
);

export default CustomButton;
